import React from 'react';
import SecondaryHeader from './SecondaryHeader';

const Projects = () => {
    return (
        <div className="ui inverted segment">
            <div className="ui grid">
                <SecondaryHeader />
                <div className="ten wide column">
                    <h1>Projects</h1>
                    <h1>2021</h1>
                    <h2>React Website Portfolio</h2>
                    <div className="ui divider"></div>
                    <i>Posted: XXX</i>
                    <p>Personal website to display skills, as well as discuss computer science topics.</p>
                    <h1>2020</h1>
                    <h2>Patient Management System</h2>
                    <div className="ui divider"></div>
                    <i>Posted: XXX</i>
                    <p>System to keep track of defibrillator patients billing information.</p>
                    <h2>Face Mask Detector</h2>
                    <div className="ui divider"></div>
                    <i>Posted: XXX</i>
                    <p>A library and command line utility for detecting face masks in images and video streams.</p>
                </div>
            </div>
        </div>
    );
};

export default Projects;
